.globl main
main:
	# la $v1, background # $v1 contains address for current background
	li $s0, BASE_ADDRESS # $s0 stores the base address for display
	li $s1, MAX_ADDRESS # $s1 stores the address of last pixel for display
	la $s2, player	# s2 contains address for colors of current player
	
loadMainMenu:	# draw main menu to bitmap display
	# la $t0, 0($v1)  # load the address of the background colors array into $t0
	la $t1, 0($s0)	# load BASE_ADDRESS into $t1
	drawMainMenu:
		bge $t1, $s1, loadPlayer	# loop until current address ($t1) is greater than or equal to MAX_ADDRESS
			li $t2, 0xffffff		# $t2 = 0($t0), load the pixel from the background
			sw $t2, 0($t1)			# $t1 = 0($t2), store the background pixel into the bitmap
			addi $t0, $t0, 4
			addi $t1, $t1, 4
			j drawMainMenu

loadPlayer:
	la $t0, 0($s2)	# $t0 contains current address for the player colors
	la $t1, PLAYER_START_ADDRESS # $t1 contains the start address for the player on the bitmap
	la $t2, 0 # $t2 will loop from i = 0 to i = 4 * 16
	li $t3, 0	# $t3 will increment by 1 from 0 to 32 to indicate when to increment the y-coordinate
	drawPlayer:
		bge $t2, 256, END
			li $t4, 0x000000	# $t4 = 0($t0), load the pixel color from the player
			sw $t4, 0($t1)	# $t1 = 0($t4), store the player color pixel into the bitmap
			addi $t0, $t0, 4
			addi $t1, $t1, 4
			addi $t2, $t2, 4
			addi $t3, $t3, 1
			beq $t3, 8, incrementRow
			j drawPlayer
			incrementRow:
				subi $t1, $t1, 4
				addi $t1, $t1, 228
				li $t3, 0
				j drawPlayer
		
